import React from 'react';
import './CSS/prompt.css'

function TopButton() {
    return (
        <div className='topButton' onclick={() => { document.body.scrollTo(0, 0) }}>
        </div>);
}

class prompt extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <div></div>
        );
    }
}

export {
    prompt,
    TopButton
};
